import React from 'react';
// Remove any CSS imports for now
// import './App.css';

function App() {
  return (
    <div style={{ 
      backgroundColor: 'blue', 
      color: 'white', 
      padding: '20px',
      textAlign: 'center',
      marginTop: '50px' 
    }}>
      <h1 style={{ fontSize: '32px' }}>Expat Traveller</h1>
      <p style={{ fontSize: '18px' }}>This is a test to see if styles are working</p>
      <button style={{ 
        backgroundColor: 'yellow', 
        color: 'black', 
        padding: '10px 20px',
        border: 'none',
        borderRadius: '20px',
        fontWeight: 'bold',
        marginTop: '20px'
      }}>
        Test Button
      </button>
    </div>
  );
}

export default App;
